import React from "react";

const Clients = () => (
  <section className="bg-white rounded shadow p-4">
    <h2 className="text-xl font-semibold mb-2">Clients</h2>
    <button className="bg-blue-500 text-white px-3 py-1 rounded mb-2">Add Client</button>
    <ul>
      <li>John Doe <span className="ml-2 text-xs bg-green-100 text-green-700 px-2 py-1 rounded">VIP</span></li>
      <li>Jane Smith <span className="ml-2 text-xs bg-yellow-100 text-yellow-700 px-2 py-1 rounded">Ongoing</span></li>
    </ul>
  </section>
);

export default Clients;
